import React, { Component } from 'react';
import PlantillaG from './PlantillaG';
import { Button } from '@material-ui/core';
const stylebutton = {
    background: "#e95a0c",
    borderRadius: 3,
    border: 0,
    color: 'white',
    width : '100%',
    height: 48,
    padding: '0 10px',
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
   // marginLeft: 20,
    marginTop: 5,
   // marginRight: 20
  };
  
class LoginFormulario extends Component {

    constructor(props){
       super(props) 
       this.state={
           isloged: this.props.isloged,
           usuario : "",
           pass : ""
       }
       
    }
    render() {
        return (
            <PlantillaG>
            <h2>Inicio de sesion para el acceso a la BD </h2>
            <table>
           <tbody>
             <tr>
               <th>
                Usuario
               </th>
               <th>
           <input type="text"  onChange={this.handleNameChange} />
               
               </th>
             </tr>
         
            
        
             <tr>
               <th>
                Contrase√±a 
               </th>
               <th>
               <input type="password" onChange={this.handlepasswordChange} />
               </th>
             </tr>
             <tr >
               <th><Button variant="contained"  style={stylebutton} >iniciar sesion</Button>
               </th>
             </tr>
           </tbody>
         </table>
          </PlantillaG>
   
          
        );
    }
}

export default LoginFormulario;
